import styled from '@emotion/styled';
import { Container } from '@mui/material';
import React from 'react';
import Photo from './Assests/AssestPhotoSample.avif'

import '@fontsource/inter/300.css';
import '@fontsource/inter/400.css';
import '@fontsource/inter/500.css';
import '@fontsource/inter/700.css';

// Styled
const AssestBlock = styled('div')(() => ({
  display: "flex",
  width: 250
}))

const AssestPhoto = styled('div')(({ theme }) => ({
  display: "block",
  backgroundColor: "red",
  width: '100%',
  height: 250,
  borderRadius: '10px'
}))

// Components
function Assest({ Photo }) {
  <AssestBlock>
    <Assest >
      {Photo}
    </Assest>
  </AssestBlock>
}

function App() {
  return (
    <Container fixed>
      <h3>Explore</h3>
      <Photo />
    </Container>
  );
}

export default App;
